import React from "react";
interface IPROPS{
    name:String,
    email:String,
    description:String
}

let Customer:React.FC<IPROPS> = ({name,email,description}) => {
    return(
        <div>
            <h1>Customer Component</h1>
            <h4>Name : {name}</h4>
            <h4>Email : {email}</h4>
            <h5>Description : {description}</h5>
        </div>
    )
}

export default Customer
